// src/pages/Navigation.js
import React, { useEffect } from 'react';
import { Container, Typography, Paper, Select, MenuItem, TextField, Button } from '@mui/material';
import { Box } from '@mui/system';
import { EventHandlingModule } from '../modules/EventHandlingModule';

export const Navigation = () => {
    useEffect(() => {
        // Initialize event listeners after mount
        const timeoutId = setTimeout(() => {
            EventHandlingModule.initializeEventListeners();
        }, 0);

        return () => {
            clearTimeout(timeoutId);
            const scroll = document.getElementById('scroll');
            if (scroll) scroll.onscroll = null;
        };
    }, []);

    return (
        <div className="container">
            <div className="header">
                <select name="Color Theme" id="theme-dropdown">
                    <option value="light">Default</option>
                    <option value="dark">Dark</option>
                    <option value="secondary">Secondary</option>
                    <option value="winter">Winter</option>
                </select>

                <div id="title">
                    <div style={{
                        display: 'flex',
                        flexWrap: 'wrap',
                        alignItems: 'center',
                        justifyContent: 'center',
                        gap: '1rem'
                    }}>
                        <img
                            id="titleicon"
                            style={{
                                width: '100px',
                                height: 'auto'
                            }}
                            src="/hseapps.0051872e.png"
                            alt="HseAPPS Logo"
                        />
                        <span>HSE Maps</span>
                    </div>
                </div>
            </div>

            <div id="inputdiv" style={{
                display: 'flex',
                flexDirection: 'column',
                alignItems: 'center',
                gap: '1rem',
                margin: '1rem 0'
            }}>
                <div style={{
                    display: 'flex',
                    flexWrap: 'wrap',
                    justifyContent: 'center',
                    gap: '1rem'
                }}>
                    <input className="textbox" type="text" id="start" placeholder="Start" />
                    <input className="textbox" type="text" id="end" placeholder="Destination" />
                </div>
                <button id="btn" onClick={() => window.markShortestPathFromInput()}>Route</button>
            </div>

            <div id="svgdiv" style={{ position: 'relative' }}>
                <div id="scroll"><div></div></div>
                <svg 
                    id="svg" 
                    xmlns="http://www.w3.org/2000/svg" 
                    version="1.1" 
                    viewBox="0 0 1308 2048"
                >
                    <g>
                        <g id="svgraph">
                            <g>
                                <image
                                    id="map"
                                    width="2048"
                                    height="1308"
                                    preserveAspectRatio="none"
                                    href="/elements/mainfloorcrunched.png"
                                />
                                <g id="graph"></g>
                            </g>
                        </g>
                    </g>
                </svg>
            </div>

            <div id="progbarcontainer" style={{
                margin: '1rem 0',
                display: 'flex',
                justifyContent: 'center'
            }}>
                <input 
                    title="Progress" 
                    type="range" 
                    min="0" 
                    max="200" 
                    defaultValue="0" 
                    id="progbar"
                />
            </div>

            <div id="schedulecontainer" style={{
                display: 'flex',
                justifyContent: 'center',
                gap: '1rem'
            }}>
                <input className="textbox" title="Schedule" type="text" id="sched" />
                <input 
                    id="btn" 
                    type="button" 
                    onClick={() => window.navSchedule()} 
                    value="Schedule"
                />
            </div>
        </div>
    );
};
